import './App.css';
import {createStore, applyMiddleware, compose} from 'redux';
import thunk from 'redux-thunk';
import {userReducer} from './redux/Reducers'

import {Provider} from 'react-redux'
import MainFile from './MainFile.js'


let store = createStore(userReducer, compose(applyMiddleware(thunk), window.__REDUX_DEVTOOLS_EXTENSION__()));
function App() {
  return (
    <Provider store = {store}>
      <nav class="navbar navbar-dark bg-primary">
        <span class="navbar-brand mb-0 h1">Expense Management System</span>
      </nav>
      <h4> Below are some users listed, available at "https://jsonplaceholder.typicode.com/users/" </h4>
      <MainFile/>
    </Provider>
  );
}

export default App;
